import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination } from 'swiper';

// Swiper's JS initialization modules for functionality
import 'swiper/swiper-bundle.min.js';
import './ImageSlider.css'; // Your custom styles

function ImageSlider() {
  return (
    <Swiper
      modules={[Navigation, Pagination]}
      spaceBetween={30}
      centeredSlides={true}
      autoplay={{ delay: 5000, disableOnInteraction: false }}
      pagination={{ clickable: true }}
      navigation={true}
      loop={true}
    >
      <SwiperSlide>
        <div className="slide-content">
          <img src="/img/slide1.png" alt="Slide 1" className="carousel-image" />
          <div className="slide-text">
            <h2>¡Queremos conocerte!</h2>
            <p>
              Participa del sorteo de 4 Laptops HP Notebook o similares completando nuestra{' '}
              <a href="#">Encuesta Alumno UTP aquí</a>.
            </p>
          </div>
        </div>
      </SwiperSlide>

      <SwiperSlide>
        <div className="slide-content">
          <img src="/img/slide2.png" alt="Slide 2" className="carousel-image" />
          <div className="slide-text">
            <h2>Fecha de sorteo: 04 de octubre</h2>
            <p>
              Responde la encuesta y participa del sorteo de 1 de 4 Laptops HP Notebook o similares.
            </p>
          </div>
        </div>
      </SwiperSlide>

      {/* Add more slides as needed */}
    </Swiper>
  );
}

export default ImageSlider;
